class Databutton extends React.Component {
    // This syntax ensures `this` is bound within handleClick.
    // Warning: this is *experimental* syntax.
    handleClick = () => {
        console.log('this is:', this);
    }

    render() {
        return (
            <div className="shadowClass" onClick={this.handleClick}>
                <button class="button">
                    <span class="fa fa-star leftAlign starSize"></span>
                    <span class="centerText"> Do. Or do not. There is no try </span>
                    <span class="fa fa-star rightAlign fa-lg starSize"></span>
                </button>
            </div>
        );
    }
}
